import * as types from './graphql';
import { TypedDocumentNode as DocumentNode } from '@graphql-typed-document-node/core';

const documents = {
    "\n  mutation GenerateUserToken($userId: UUID!) {\n    generateUserToken(userId: $userId)\n  }\n": types.GenerateUserTokenDocument,
};

export function graphql(source: "\n  mutation GenerateUserToken($userId: UUID!) {\n    generateUserToken(userId: $userId)\n  }\n"): (typeof documents)["\n  mutation GenerateUserToken($userId: UUID!) {\n    generateUserToken(userId: $userId)\n  }\n"];

export function graphql(source: string): unknown;
export function graphql(source: string) {
  return (documents as any)[source] ?? {};
}

export type DocumentType<TDocumentNode extends DocumentNode<any, any>> = TDocumentNode extends DocumentNode<  infer TType,  any>  ? TType  : never;